JS{{
var val = @{panner_right}
var valCalc = Math.round (val/127*200)

if (valCalc >= 0) {valCalc = valCalc - 100}
if (valCalc === 0) {return valCalc + " C"} 
if (valCalc < 0) {return Math.abs(valCalc) + " L"} 
if (valCalc > 0) {return valCalc + " R"} 
}}

