  position: absolute;
  width: 100%;
  height: var(--led-height);
  top: 50%;
  margin-top: calc(-0.5 * var(--led-height));
}
.vpot .led:after, .led:before {
  content: "";
  position: absolute;
  width: var(--led-width);
  height: var(--led-height);
  left:5rem;top:0;
  background: red;
  border-radius: 50%;
  opacity: var(--led-opacity);
}
